import Link from 'next/link';

const Navbar = () => {
  const styles = {
    display: "flex",
    justifyContent: 'space-between',
    backgroundColor: 'grey',
    padding: '1rem'
  }
  return (
    <div style={styles}>
      <Link href='/'><a>Home</a></Link>
      <Link href='/about'><a>About</a></Link>
      <Link href='/contact'><a>Contact</a></Link>
    </div>
  )
}

export default Navbar;
